def rem_move(mv):
    key = list(moveDict.keys())[list(moveDict.values()).index(mv)]
    if key == None:
        print("invalid move")
        exit(1)
    conn.sendline(key.encode())
    r = conn.recvline(timeout=0.3)
    if b'BONK' in r:
        return False
    if b'ictf' in r:
        print(r)
    return True
